// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract LockHolder is Ownable, IERC721Receiver {

    mapping(address => mapping(uint256 => address)) private _holders;

    address public locker;

    constructor(address _locker, address _owner) {
        locker = _locker;
        _transferOwnership(_owner);
    }

    function setLocker(address _locker) public onlyOwner {
        locker = _locker;
    }

    modifier onlyLocker() {
        require(locker == msg.sender, "Locker: caller is not the allowed locker");
        _;
    } 

    function lock(address collection, uint256[] memory tokenIds) public {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            IERC721(collection).safeTransferFrom(msg.sender, address(this), tokenIds[i]);
        }
    }

    function unlock(address collection, address owner, uint256[] memory tokenIds) public onlyLocker {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            require(_holders[collection][tokenIds[i]] != address(0), "Token not locked for unlocking");

            _holders[collection][tokenIds[i]] = address(0);
            IERC721(collection).safeTransferFrom(address(this), owner, tokenIds[i]);
        }
    }

    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) public virtual override returns (bytes4) {
        require(operator == address(this), "Only the LockHolder contract can pull tokens in");

        _holders[msg.sender][tokenId] = from;

        return this.onERC721Received.selector;
    }

    function lockedBy(address collection, uint256 tokenId) public view returns(address) {
        return _holders[collection][tokenId];
    }
}

